import functools
import itertools
def superFunctionalStrings(s):
    result = set()
    for i in range(len(s)+1):
        for j in range( i + 1, len(s)+1): 
            result.add(s[i:j]); 
    result = list(result)
    substr_results = []
    for i in result:
        substr_results.append((pow(len(i),len(set(list(i)))) % (pow(10,9) + 7)))
    return (functools.reduce(lambda a,b: a+b,substr_results) % (pow(10,9) + 7))


